  false,\n\t\"url\": null,\n\t\"notes\": \"The purpose of this Addendum is to clarify
  actions that will be taken under the selected alternative for the Fire Management
  Plan Environmental Assessment that was approved on March 22, 2002 when a Finding
  of No Significant Impact (FONSI) was signed. This includes documenting the need
  for fuels management  treatments, including specifically the use of mechanical fuels
  treatments on Necedah National Wildlife Refuge while reaffirming these needs based
  upon the context of previously written and approved management plans and the construction
  of a fire break trail on the Eastern boundary of the Refuge.\",\n\t\"owner_org\":
